import React, { FC } from 'react';
import './styles/LoginForm/LoginForm.css'
import Title from './UI/Title/Title';


const LoginForm: FC = () => {

    const h3Styles = {
        'fontFamily': 'SF Pro Display',
        'fontWeight': 400,
        'fontSize': '30px',
        'lineHeight': '36px',
        'color': '#0D1C41',
        'marginTop': '72px',
        'text-align': 'center'
    }

    return (
        <div className='LoginForm'>
            <h3 style={h3Styles}>Регистрация</h3>
        </div>
    );
};

export default LoginForm;
